import React from 'react'

const Header = (props) => {
    return (
        <div>
            <h1 style={headingstyle}>{props.title}</h1>
        </div>
    )
}
Header.defaultProps ={
    title:'traker',
}
const headingstyle ={
    color: 'red',
    backgroundColor: 'black',
}
export default Header
